import {BrowerRouter, Route,Routes} from 'react-router-dom';
import Home from './Pages/Home';

function App() {
  return (
   <>
  <BrowerRouter>
    <Routes>
      <Route path="/" element={<Home></Home>}/>
    </Routes>
  </BrowerRouter>
   </>
  );
}

export default App;
